function initMap(){distanceService=new google.maps.DistanceMatrixService}var distanceService;$(function(){$(".search-btn").on("click",function(e){e.preventDefault();var t=$("#from").val(),a=$("#to").val();distanceService.getDistanceMatrix({origins:[t+" New Zealand"],destinations:[a+" New Zealand"],travelMode:google.maps.TravelMode.DRIVING,unitSystem:google.maps.UnitSystem.METRIC,durationInTraffic:!0,avoidHighways:!1,avoidTolls:!1},function(e,t){if(t!==google.maps.DistanceMatrixStatus.OK)console.log("Error:",t);else{var a=e.rows[0].elements[0].distance.value,i=e.rows[0].elements[0].distance.text,n=e.rows[0].elements[0].duration_in_traffic.text;$(".vehicals h1>span").html(a),$(".distance").html(i),$(".time").html(n)}})})});